import React, {Component} from 'react';

class Serverconnector extends Component {
    constructor() {
        super();
    }
    ComponentDidMount() {
        fetch('http://127.0.0.1:1812/')
            .then(Response => Response.json())
            .then(console.log)
    }
}

export default Serverconnector;
